import firebase from "firebase/app";
import "firebase/storage";

// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
apiKey: "AIzaSyAjmz_RqnLQGSEpBn2T86yi2ch1E1x-gak",
authDomain: "op-blog.firebaseapp.com",
projectId: "op-blog",
storageBucket: "op-blog.appspot.com",
messagingSenderId: "388554263535",
appId: "1:388554263535:web:6d5a822d5b6dcf5f90041a",
measurementId: "G-N0QWV2Z4LW"
};

firebase.initializeApp(firebaseConfig);

const storage = firebase.storage();

export {storage, firebase as default };
